f1 = 'EXP(2*x)'
vd = 'x:2'
F1 = symdif.SD(f1)
F1.set_point(vd)
assert str(F1.symbolic_diff('x', order=1, output='default')
    ) == '2.0*exp(2.0*x)'
assert str(F1.symbolic_diff('x', order=2, output='default')
    ) == '4.0*exp(2.0*x)'
assert str(F1.symbolic_diff('x', order=3, output='default')
    ) == '8.0*exp(2.0*x)'
